          <Sectiontitle title="Contact"/>
          <h6>I can best be reached through social media or via <a href="mailto:austin@austincepalia.com">email</a>.</h6>
          <br></br>
          <Socialicons />

        </div>
      </div>
    </Layout>


  );
}

export default Contact;
